engine.on('OnCustomGameSlotClick', function (player) {
    var current = testCustomGameSlots[player].playFabId

    if (current == globalState.playFabId) // can't boot ourselves
        return

    var playFabId = ""
    if (current == "_open") {
        testCustomGameSlots[player].value = "Bot"
        testCustomGameSlots[player].playFabId = "_bot"
    }
    else if (current == "_closed") {
        testCustomGameSlots[player].value = "Open"
        testCustomGameSlots[player].playFabId = "_open"
    }
    else {
        testCustomGameSlots[player].value = "Closed"
        testCustomGameSlots[player].playFabId = "_closed"
    }

    engine.trigger('setCustomGameSlot', player, testCustomGameSlots[player].value, testCustomGameSlots[player].playFabId)
})
engine.on('OnCustomGameSlotSwap', function (player) {
    if (player == mySlotIndex) // can't swap ourselves
        return

    testCustomGameSlots[player].value = testCustomGameSlots[mySlotIndex].value
    testCustomGameSlots[player].playFabId = testCustomGameSlots[mySlotIndex].playFabId
    testCustomGameSlots[mySlotIndex].value = "Open"
    testCustomGameSlots[mySlotIndex].playFabId = "_open"

    engine.trigger('setCustomGameSlot', player, testCustomGameSlots[player].value, testCustomGameSlots[player].playFabId)
    engine.trigger('setCustomGameSlot', mySlotIndex, testCustomGameSlots[mySlotIndex].value, testCustomGameSlots[mySlotIndex].playFabId)

    mySlotIndex = player
})
