// Developer hotkeys to show off different UI modes
// https://keycode.info/
document.onkeydown = function (evt) {
    evt = evt || window.event;
    if (evt.keyCode == 27) {
        engine.trigger('escape')
        evt.preventDefault()
    }

    if (globalState.currentView == "game") {
        if (evt.keyCode == 49) {
            engine.trigger('clickHome')
        }
        if (evt.keyCode == 50) {
            engine.trigger('toggleWindshieldLock')
        }
        if (evt.keyCode == 51) {
            engine.trigger('toggleGloveboxLock')
        }
        if (evt.keyCode == 52) {
            engine.trigger('toggleLeftboxLock')
        }
        if (evt.keyCode == 81) {
            engine.trigger('refreshDashboardActions', testAlternateBuildings)
            engine.trigger('enableHome', true)
        }
        if (evt.keyCode == 87) {
            engine.trigger('enableAiming', !globalState.aiming)
            console.log("enableAiming: " + globalState.aiming)
        }

        if (evt.keyCode == 192) {
            engine.trigger('enableScoreboard', true)
        }

        if (evt.keyCode == 13) {
            engine.trigger('toggleInGameChat')
        }

        if (evt.keyCode == 71) { // G
            engine.trigger('enablePingChooser', true, 500, 500, false)
            engine.trigger('setPingChooserImage', 'smartping_0.png')

            // test dynamically
            //engine.trigger('mouseoverPingChooser', 0, 0)
            engine.trigger('mouseoverPingChooser', 100, 200)

            // test explicitly
            //engine.trigger('setPingChooserHoverIndex', 2)
            //engine.trigger('activatePingChooserIndex', 2)
        }

        if (evt.keyCode == 72) { // H
            engine.trigger('enableEmoteChooser', true, 500, 500, true)
        }

        if (evt.keyCode == 79) { // O
            engine.trigger('loadPopup', 'defeat')
        }

        if (evt.keyCode == 80) { // P
            engine.trigger('loadPopup', 'victory')
        }

        if (evt.keyCode == 59) { // ;
            engine.trigger('loadPopup', 'tie')
        }

        globalState.isAltHeld = false
        if (evt.keyCode == 18) // Alt
        {
            globalState.isAltHeld = true
        }
    }

    if (evt.keyCode == 219) {
        loadPopupYesCancel("Join Lisk's party?", "", function () { console.log("Joined lisk's party!") }, function () { console.log("Rejected lisk's party invite") })
    }
}

